import React from 'react';
import {FaHeart} from 'react-icons/fa'

const Picture = ({source, firstName, lastName, likes}) => {
    return (
        <div className="tile">
            <p>Uploaded By: {firstName} {lastName}</p>
            <p>
            <FaHeart/> {likes} 
            </p>
            <img className="picture" src={source} alt='' />
        </div>
    );
}

export default Picture
